import React from 'react';
import Paper from "@material-ui/core/Paper";


export default function Questions(props) {

    const question = props => {
        props.getQuestionId(2);
    };

    console.log(question.title);

    return(
        <Paper>
            <h1>Detail's page</h1> 
            <p>{question.title}</p> 
        </Paper>
    )
}
